import React from 'react';
import { Container, Row, Col } from 'reactstrap';

import styles from './Person.module.css';

const person = (props) => {
    console.log("PROPS IN THE PERSON ITSELF:", props)
    return (
        <Container className={styles.Person}>
            <Col xs="6" sm="4">{props.id}</Col>
            <Col xs="6" sm="4">{props.name}</Col>
            <Col xs="6" sm="4">{props.number}</Col>
        </Container>
    );
}

export default person;
